bookmarks = []
session = requests.Session()

# Add a User-Agent header to mimic a browser
session.headers.update({
    "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36"
})

for entry in data:
    url = entry.get('url')
    if url and "supjav" in url:
        for attempt in range(3):  # Retry up to 3 times
            try:
                response = session.get(entry["url"], timeout=5)
                response.raise_for_status()  # Raise an error for HTTP error responses

                if response.status_code == 404:
                    print(f"Skipping {entry['url']} - Page not found (404).")
                    break  # Skip this entry if 404
                # Parse the HTML content
                soup = BeautifulSoup(response.text, 'html.parser')

                # Get the title of the page, defaulting to a placeholder if not found
                title = soup.title.string if soup.title else f"Page Title {entry['id']}"

                # Replace tag IDs with titles
                tag_titles = [tag_mapping.get(tag_id, tag_id) for tag_id in entry["tags"]]

                bookmarks.append({
                    "title": title,
                    "url": entry["url"],
                    "tags": tag_titles
                })
                break  # Exit retry loop if successful
            except requests.exceptions.RequestException as e:
                print(f"Error fetching {entry['url']} on attempt {attempt + 1}: {e}")
                time.sleep(2)  # Wait a bit before retrying

# Save bookmarks to a JSON file
with open('bookmarks.json', 'w', encoding='utf-8') as f:
    json.dump(bookmarks, f, ensure_ascii=False, indent=4)

print("Bookmarks saved to bookmarks.json")
